widgets_values:
* {
    font-family: Arial;
  }


  .startPage {
    position: absolute;
    width:auto;
    z-index: 0;
    transition: transform 0.3s ease;
  }

  .startPage:hover {
    transform: translateY(-1%);
  }

  .hoverContainer {
    background: black;
    border-radius: 27px;
    padding: 50px;
    display: flex;
    flex-direction: row;
    margin: 12px auto;
    position: relative;
  }

  .header {
    padding-bottom: 24px;
    margin-bottom: 24px;
    border-bottom: 1px solid #3e3e3e;
    width: 200%;
    height: 72px;
    display: flex;
    align-items: center;
    justify-content: space-between;
  }

  .header_discrip {
    font-size: 21px;
    font-weight: 200;
    color: #6f6f6f;
  }

  .size-smallButton {
    font-size: 21px;
    border-radius: 12px;
    height: 48px;
    min-width: 48px;
    display: flex;
    align-items: center;
    justify-content: center;
    width: 100%;
    cursor: pointer;
  }

  .style-input {
    background: #2a2a2b;
    padding: 12px;
    transition: background 0.3s;
  }

  .style-input:hover {
    background: #3b3b3c;
  }
a:not(:first-child) {
      margin-left:8px;}
  a {
    color: #b6b6b7;
  }

  a:hover,
  a:hover .header_discrip {
    color: #dddddd !important;
  }
